import {useState, useRef } from 'react';
import { Typography,Container,makeStyles,Card,CardMedia,Avatar,CardContent } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  container:{
    display: "flex",
    border: "1px solid #ece7e7",
  },
  media:{
    height: 250,
    position: "relative",
    [theme.breakpoints.down("sm")]:{
      height: 150,
    },
  },
  large: {
    width: theme.spacing(10),
    height: theme.spacing(10),
    position: "absolute",
    left: 0,
    right: 0,
    border: `2px solid ${theme.palette.background.paper}`,
  },
}));

export default function CardProfile(props) {
  const classes = useStyles();
  const [img1, setImg1] = useState('/broken-image.jpg')

  return (
      <Card>
        <CardMedia className={classes.media} image="https://material-ui.com/static/images/cards/paella.jpg" />
        <Avatar src={img1} className={classes.large} />
      </Card>



  );
}
